const doTransforDateToStamp = (date) => {
  let dateStamp = date.substring(0, 19);
  dateStamp = dateStamp.replace(/-/g, '/');
  return new Date(dateStamp).getTime();
};

const doFilterDate = (beforeDate, afterDate) => {
  if (!beforeDate || !afterDate) {
    return true;
  }
  const timeStampCurrent = doTransforDateToStamp(beforeDate);
  const timeStampRangeAfter = doTransforDateToStamp(afterDate);
  return timeStampCurrent < timeStampRangeAfter;

};

const doPageFilter = (limit, currentPage, data) => {
  if (!limit || !currentPage) {
    return data;
  }
  const res = [...data];
  return res.splice((currentPage - 1) * limit, limit);
};

const getTableData = (req, tableDatas) => {
  const requestBody = req.body;
  const {searchInfo} = requestBody;
  const {data} = tableDatas;
  if (!searchInfo) return {data, total: data.length};
  const {limit = 4, currentPage = 1} = searchInfo;
  const newArray = doFilerDataBySearch(data, searchInfo);
  // return newArray;
  const resData = doPageFilter(limit, currentPage, newArray);
  return {data:resData, total: data.length};
};

const doFilerDataBySearch = (data, searchInfo) => {
  const {name, job, limit = 4, currentPage = 1, startTime, endTime, id} = searchInfo;

  if ((!name || name === '') && (!job || job === '') && (!startTime || startTime === '') && (!endTime || endTime === '') && (!id || id === '')) {
    return doPageFilter (limit, currentPage, data);
  }

  let filterData = [...data];

  for (let key in searchInfo) {
    filterData = filterData.filter(item => {
      if (key ==='endTime' ) {
        return doFilterDate(item.createTime,searchInfo[key]);
      }

      if ( key ==='startTime') {
        return doFilterDate(searchInfo[key],item.createTime);
      }
      if (!searchInfo[key] || !item[key]) {
        return item;
      }
      return searchInfo[key] && item[key].toString().indexOf(searchInfo[key].toString()) !== -1;
    })
  }
  return filterData;
};

const getDeleteData = (req, tableDatas) => {
  const requestBody = req.body;
  const {searchInfo: {id}} = requestBody;
  const {data} = tableDatas;
  for (let i = 0; i < data.length; i++) {
    if (data[i].id === id) {
      data.splice(i, 1);
      break;
    }
  }
  return {data};
};

const getAddData = (req, tableDatas) => {
  const requestBody = req.body;
  const {searchInfo: {id}} = requestBody;
  const {data} = tableDatas;
  for (let i = 0; i < data.length; i++) {
    if (data[i].id === id) {
      data.splice(i, 1);
      break;
    }
  }
  return {data};
};

